import '../css/Home.css';

function Home() {
  return (
    <div className="home">
        <span>Ben Cruise - </span>
        <span>Freelance Web Developer </span>
        <span>and Designer</span>
        <p>User-Focused Designer with advanced skills in React, Javascript, HTML and CSS, amongst other languages and frameworks.</p>      
        <button className="p-3 m-3">PROJECTS</button>

    </div>    
  );
}

export default Home;
